INSERT INTO `tbl_message` VALUES (5,'2017-02-10','Test','Test',94,8),(6,'2017-02-11','Échange PR','Salut Mike, c\'est pour t\'informer d\'un échange de quart de PR, P-O Brown prend mon chiffre du mardi 14 et je prends son mercredi 22.\r\n\r\nMerci !\r\n\r\nBenoit Gagnon 141\r\n418-999-2920',94,8),(7,'2017-02-14','Commande de vêtements','Bonjour à tous,\r\n\r\nce message est pour vous informer que dès demain vous aurez à votre disposition de votre pigeonnier un formulaire de commande de vêtements. Celui-ci me servira à passer vos commandes avec les différents fournisseurs et me permettra également de traiter vos demandes plus efficacement.\r\n\r\nVous devez remplir cette feuille seulement si vous avez besoin de commander des articles. Vérifier plus particulièrement vos pantalons, chemises et bottes car cette commande devrait normalement arriver avant le début des visites de prévention.\r\n\r\nAprès avoir compléter le formulaire, veuillez le déposer dans l\'ancienne boîte de suggestion, maintenant boîte de commande de vêtements blue/black. Assurez-vous d\'avoir bien remplis le questionnaire et de façon lisible. Veuillez inscrire la grandeur de l\'article désiré seulement si il y a changement depuis votre dernière commande. La section commentaire vous permettra d\'y inscrire par exemple : trous au niveau de l\'entrejambe, chemise décoloré, bris suite à une intervention, etc.\r\n\r\nN\'oubliez pas que nous avons un droit de regard sur les articles que vous passerez en commande et qu\'ils ne seront par commandé si nous pensons qu\'il y a abus. À titre d\'exemple un pompier temps partiel ne devrait pas avoir usé suffisamment une paire de botte après un an d\'utilisation.\r\n\r\nJe ramasserai les formulaires de commande le 1 mars 16h00. Après cela il sera trop tard pour commandé, à moins d\'une situation exceptionnelle. \r\n\r\nMerci de votre habituelle collaboration.\r\n\r\nBenoit Gagnon 141\r\n418-999-2920',94,8),(8,'2017-02-15','tâche PR 18-19 février 2017','Bonjour à vous et merci de votre présence à cette activité.\r\n\r\nLe 18-19 février de au parc de glisse du grand héron.\r\n\r\nResponsable Alain Vézina\r\n\r\nLe 18 février Maxime Fortin et William Bélanger  de 8 h 30 à 17H00\r\nLe 19 février Mélanie Lévesque et William Bélanger e 9 h 30 à 17H00\r\n\r\nLe véhicule 910 sera à votre disposition et la trousse du 1010 et matériel médical sera utiliser.\r\n\r\nUn plan des lieux est inclus et sera disponible papier dans le 910\r\n\r\nUne clé de l’infirmerie du centre Desjardins vous sera remis pour vous réchauffé et y mettre le matériel médical sensible au gel.\r\n\r\n\r\n\r\nPlus de détail à venir\r\n',93,8),(9,'2017-02-15','','Bonjour à vous et merci de votre présence à cette activité.\r\n\r\nLe 18-19 février de au parc de glisse du grand héron.\r\n\r\nResponsable Alain Vézina\r\n\r\nLe 18 février Maxime Fortin et William Bélanger  de 8 h 30 à 17H00\r\nLe 19 février Mélanie Lévesque et William Bélanger e 9 h 30 à 17H00\r\n\r\nLe véhicule 910 sera à votre disposition et la trousse du 1010 et matériel médical sera utiliser.\r\n\r\nUn plan des lieux est inclus et sera disponible papier dans le 910\r\n\r\nUne clé de l’infirmerie du centre Desjardins vous sera remis pour vous réchauffé et y mettre le matériel médical sensible au gel.\r\n\r\n\r\n\r\nPlus de détail à venir\r\n',93,8),(10,'2017-02-15','Sac de fontainier 212','Bonjour à tous! Petite mise à jour pour le sac de fontainier du véhicule 212. Il est dorénavant situé à l’arrière du camion à droite. Cela le rend plus accessible. \r\n\r\nMerci et bonne journée \r\n',96,8),(11,'2017-02-15','Pratique','Bonjours à tous. Simplement de ne pas oublié la pratique de se soir. Je vous attends pour 19:00hr dans la salle au deuxième étages.\r\n\r\nMerci \r\nLT Nicolas Tanguay 133',82,8),(12,'2017-02-20','Uniforme','Bonjours a tous, simplement un petit rappel pour vous rappeler de porté vos uniformes complet lorsque vous êtes demandé a la caserne peu importe le type d\'évènement. \r\nPAYÉ=UNIFORME\r\n\r\nMERCI de votre collaboration\r\n\r\nLT Nicolas Tanguay\r\n133 \r\n',82,8);
